def _wenshu_unjsfunk(string):
    q = {
        "!![]": "true",
        "![]": "false",
        "[][[]]": "undefined",
        "+[![]]": "NaN",
        "[]+[]": "\"\"",
        "+[]": "0",
        "+!+[]": "1",
        "!+[]+!+[]": "2",
        "[+!+[]]+[+[]]": "10"
    }
    s = string
    for i in range(10):
        for a,b in q.items():
            s = s.replace(a,b)
    d = re.findall(r'(?:\+!0)+', s)
    for i in d:
        s = re.sub(r'(?:\+!0)+', str(i.count('+!0')), s, 1)
    hs = ''.join(map(lambda i:chr(int(i)),re.findall(r'fromCharCode\(([^\)]+)\)', s)[0].split(',')))
    for idx,i in enumerate(hs):
        s = s.replace('$hidescript[{}]'.format(idx), repr(i))
        s = s.replace('$hidescript[({})]'.format(idx), repr(i))
    s = s.replace('(true0)', '"true"')
    s = s.replace('(false0)', '"false"')
    s = s.replace('!01', '2')
    s = s.replace('!02', '3')
    s = s.replace('""+undefined', '"undefined"')
    s = s.replace('""+{}', '"[object Object]"')
    s = s.replace('[false]+{}', '"false[object Object]"')
    s = s.replace('[true]+{}', '"true[object Object]"')
    s = s.replace('1+[0]','10')
    # 以下是为了文书网进行的特殊处理
    s = s.split("""'"'""")[1].strip('+')
    for i in range(10):
        d = re.findall(r'"([^"]+)"\+"([^"]+)"',s)
        for a,b in d:
            s = re.sub(r'"[^"]+"\+"[^"]+"', '"{}"'.format(a+b), s, 1)
    s = re.sub(r'\(("[^"]+")\)',r'\1',s)
    d = re.findall(r'("([^"]+)"\[([^\[\]]+)\])',s)
    for i in d:
        a,b,c = i
        try:
            s = re.sub(r'("([^"]+)"\[([^\[\]]+)\])', repr(b[int(c)]), s, 1)
        except:
            s = re.sub(r'("([^"]+)"\[([^\[\]]+)\])', a, s, 1)
    s = s.replace("'",'')
    s = s.replace('+','')
    return s

    
